def run(value_list):
    """
    Calculates the change in Capital redemption reserve in 2019 from 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the number and scale of the change, formatted to two decimal places.
    """
    reserve_2019 = None
    reserve_2018 = None

    for item in value_list:
        if item['category'] == 'Capital redemption reserve' and item['header3'] == '2019':
            reserve_2019 = item['number_value']
        if item['category'] == 'Capital redemption reserve' and item['header3'] == '2018':
            reserve_2018 = item['number_value']

    if reserve_2019 is not None and reserve_2018 is not None:
        change = reserve_2019 - reserve_2018
        return (float(change), '')
    else:
        return (0.0, '')

