def run(value_list):
    """
    Calculates the change in Cost of revenue of Client services from 2018 to 2017.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the change in Cost of revenue and its scale.
    """

    cost_of_revenue_2018 = None
    cost_of_revenue_2017 = None

    for item in value_list:
        if item['category'] == 'Client services' and item['header1'] == 'Cost of revenue:' and item['header3'] == '2018':
            cost_of_revenue_2018 = float(item['number_value'])
        elif item['category'] == 'Client services' and item['header1'] == 'Cost of revenue:' and item['header3'] == '2017':
            cost_of_revenue_2017 = float(item['number_value'])

    if cost_of_revenue_2018 is not None and cost_of_revenue_2017 is not None:
        change = cost_of_revenue_2018 - cost_of_revenue_2017
        if change > 0:
            scale = 'tho thousand'
        elif change < 0:
            scale = 'tho thousand'
        else:
            scale = ''
        return (round(change, 2), scale)
    else:
        return (0.0, '')

