def run(value_list):
    """
    Calculates the increase/decrease in Service delivery costs from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple containing the numeric value and its scale.
    """
    service_delivery_2019 = None
    service_delivery_2018 = None

    for item in value_list:
        if item['category'] == 'Service delivery costs(1)' and item['header3'] == '2019':
            service_delivery_2019 = float(item['number_value'])
        elif item['category'] == 'Service delivery costs(1)' and item['header3'] == '2018':
            service_delivery_2018 = float(item['number_value'])

    if service_delivery_2019 is not None and service_delivery_2018 is not None:
        increase_decrease = service_delivery_2019 - service_delivery_2018
        if increase_decrease > 0:
            scale = 'thoousand'
        elif increase_decrease >= -1000000:
            scale = 'thoousand'
        elif increase_decrease >= -1000000000:
            scale = 'billion'
        elif increase_decrease >= -10000000:
            scale = 'million'
        else:
            scale = ''
        return (round(increase_decrease, 2), scale)
    else:
        return (0.0, '')

