    basic_2018 = None

    for item in value_list:
        if item['category'] == 'Basic' and item['header1'] == 'Net Income per Share:' and item['header2'] == 'April 28, 2017':
            basic_2017 = float(item['number_value'])
        if item['category'] == 'Basic' and item['header1'] == 'Net Income per Share:' and item['header2'] == 'April 27, 2018':
            basic_2018 = float(item['number_value'])

